import React from 'react'
import { AppBar, Typography } from '@material-ui/core'
import  {makeStyles} from '@material-ui/core'
const AppBars = () => {
    return (
        <div>
            <AppBar>
              <Typography>Yooo</Typography>
            </AppBar>
        </div>
    )
}

export default AppBars
